import React, { Component } from 'react';

class BuscarCliente extends Component {
    render() {
        return(
            <div className="col-12">
                <div className="card">
                    <div className="card-body">
                        <input type="text" className="form-control" />
                    </div>
                </div>
            </div>
        );
    }
}

export default BuscarCliente;
